import "./Home.scss"
import React from 'react'
import Navbar from "../components/navbar/Navbar";


 const Home = () => {
  return (
    <div className='home'>
        <Navbar />
        <img src={require("../assets/images-backg.jpg")} alt="" width="100%" />
        
    </div>
  )
}

export default Home;
